// weatherIcons.js
const weatherIcons = {
    "cloudy_day": '/images/weather/cloudy_day.png',     // Cloudy day image
    "cloudy_night": '/images/weather/cloudy_night.png', // Cloudy night image
    "clear_sky_day": '/images/weather/clear_sky_day.png', // Clear sky day image
    "clear_sky_night": '/images/weather/clear_sky_night.png', // Clear sky night image
    "rain": '/images/weather/rain.png',                   // Rain image
    "frost": '/images/weather/frost.png',                 // Frost image
  };

  export default weatherIcons;
